const initialState = {
    guess: ""
}

const PlayReducer = (state = initialState, action) => {
    switch (action.type) {
        case "GUESS":
            console.log("user Name set");
            return { ...state,guess: action.payload}
        default:
            return state;
        }
}

export default PlayReducer
